<template>
  <div class="login" >
    <el-container>
      <div class="login-left">
        <h3 class="login-title">麻雀Wiki</h3>
        <el-form ref="form" :model="form" >
            <el-form-item>
                <el-input
                  placeholder="请输入用户名"
                  prefix-icon="el-icon-user"
                  v-model="form.username">
                </el-input>
            </el-form-item>
            <el-form-item>
                <el-input
                  placeholder="请输入密码"
                  prefix-icon="el-icon-view"
                  show-password
                  @keyup.enter.native="loginSubmit"
                  v-model="form.password">
                </el-input>
            </el-form-item>
            <el-form-item>
                <el-checkbox v-model="form.checked">记住密码</el-checkbox>
            </el-form-item>
            <el-form-item style="margin-bottom: 5px!important;">
                <el-button type="primary" round size="medium" @click="loginSubmit" class="loginbtn">登陆</el-button>
            </el-form-item>
          <el-form-item>
            <el-button type="default" round size="medium" @click="registerAccount" class="loginbtn">注册账号</el-button>
          </el-form-item>
        </el-form>
      </div >
    </el-container>
  </div>
</template>

<script>
    export default {
      name: 'Login',
      data() {
        return {
          form: {
            username: '',
            password: '',
            checked: false
          }
        }
      },
      methods: {
      loginSubmit() {
        var that = this
        console.log(that.form.username, that.form.password, that.form.checked)

        that.$http.post('/api/v1/login',
          that.form
          ).then(function (response) {
          if (response.data.code === 0) {
            that.$message.success('登陆成功')
            that.$store.commit('settoken',response.data.data)
            that.$store.commit('setUsername',that.form.username)
            that.$router.push({ path: '/' })
          } else {
            that.$message.error(response.data.msg)
          }
        })
      },
      registerAccount() {
        this.$router.push('/register')
      }
    }
    }
</script>

